import { books } from "../data/books";

export default function AdminPanel({ user, onLogout }) {
  return (
    <div className="p-6">
      <div className="flex justify-between mb-4">
        <h1 className="text-2xl font-bold">Painel do Administrador</h1>
        <button onClick={onLogout} className="bg-red-500 text-white px-4 py-1 rounded">
          Sair
        </button>
      </div>
      <ul>
        {books.map((book) => (
          <li key={book.id} className="border p-4 mb-2 rounded shadow">
            <h2 className="text-lg font-bold">{book.title}</h2>
            <p className="text-sm text-gray-600">Autor: {book.author}</p>
            <p className="mt-1">{book.description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}
